import React from 'react';

class Item extends React.Component {
    constructor(props) {
        super(props)
    }

    render() {
        return (
            <div className="container">
                <div className="col-6">{this.props.item}</div>
                <div className="col-6">{this.props.item.category}</div>
            </div>
        );
    }
}
  
export default Item;
